import React, { Component } from 'react'
import './App.css';

export class Navbar extends Component {
    constructor() {
        super()
        this.state = {
            position : 'main'
        }
    }
    render() {
        return (
            <div>
                <h1>Welcome to crud App</h1>
                {
                    this.state.position === 'main' ?
                    <div>
                        <p className = 'to-the-left'>Check all User</p>
                    </div>
                    :
                    <div>
                        <p className = 'to-the-left'> Back to Main Page</p>
                    </div>

                }
                
            </div>
        )
    }
}

export default Navbar
